import React,{} from 'react'
import './Notes.css'
import Note from './Note'

function Notes() {
  const [notes, setNotes] = useState([
    {
        id:1,
        title:"title1",
        content:"content1"
    },
    {
        id:2,
        title:"title2",
        content:"content2"
    },
    {
        id:3,
        title:"title3",
        content:"content3"
    },
])
  return (
    <div className='notes'>
      <Note>
        {Notes.map((note,index)=>{
          return <h2 key={index}>{note.title}</h2>
        })}
      </Note>
      <button className='add-btn'>+</button>
    </div>
  )
}

export default Notes
